     // when we hit enter, the keyboardManager should call the selectItem method of the `ListItemComponent`\n  //       this.keyboardEventsManager.activeItem.selectItem();\n  //       return false;\n  //     }\n  //   }\n  // }\n\n  isSelected(id: number): boolean {\n    if (this.filter.selectedTypes) {\n      return this.getPositionInSelectedTypeList(id) > -1;\n    }\n    return false;\n  }\n\n  ngOnInit(): void {\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/SetAreaFilter.html":{"url":"classes/SetAreaFilter.html","title":"class - SetAreaFilter","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n  Classes\n  SetAreaFilter\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/client/app/core/ngrx/actions/filter.actions.ts\n        \n\n            \n                Description\n            \n            \n                Redux action for setting the array of currently filtered areas.\n\n            \n\n\n            \n                Implements\n            \n            \n                        Action\n            \n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                    Public\n                                payload\n                            \n                            \n                                    Public\n                                type\n                            \n                        \n                    \n                \n\n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor(payload: FieldFi